import React, { useState } from 'react';
import './addTiffinCenter.css'

const AddTiffinCenter = () => {
  const [formData, setFormData] = useState({
    name: '',
    ownerName: '',
    contactNumber: '',
    email: '',
    address: '',
    subscriptionType: '',
    description: '',
    deliveryAreas: [] // New field for selecting areas
  });

  const [areas, setAreas] = useState({
    Area1: false,
    Area2: false,
    Area3: false,
    Area4: false
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleAreaChange = (e) => {
    const { name, checked } = e.target;
    setAreas({ ...areas, [name]: checked });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const selectedAreas = Object.keys(areas).filter(area => areas[area]);
    const dataToSubmit = { ...formData, deliveryAreas: selectedAreas };

    console.log('Tiffin Center Data:', dataToSubmit);
    // Call your register function here to save to Firebase or backend
    // registerTiffinCenter(dataToSubmit, selectedAreas);
  };

  return (
    <div className="add-user-modal">
  <div className="modal-header">
    <h2>Add User</h2>
    <button className="close-btn">&times;</button>
  </div>
  
  <div className="modal-body">
    <div className="image-upload-section">
      <label for="image-upload" className="image-upload-label">
        <div className="upload-image-box">
          <span>UPLOAD IMAGE</span>
          <input type="file" id="image-upload" className="upload-image-input" accept="image/*" />
          <i className="fa fa-camera"></i>
        </div>
      </label>
    </div>
    
    <form className="user-form">
      <div className="form-group">
        <input type="text" placeholder="Full name*" required />
      </div>

      <div className="form-row">
        <div className="form-group">
          <input type="text" placeholder="Mobile number*" required />
        </div>
        <div className="form-group">
          <input type="email" placeholder="Email ID" />
        </div>
      </div>
      
      <div className="form-group">
        <select>
          <option value="">Role</option>
         
        </select>
      </div>
      
      <h4>Login Credential <span>(Below Credential will be used to login into account)</span></h4>

      <div className="form-row">
        <div className="form-group">
          <input type="text" placeholder="Username*" required />
        </div>
        <div className="form-group">
          <input type="password" placeholder="Password*" required />
        </div>
      </div>
    </form>
  </div>
  
  <div className="modal-footer">
    <button className="save-btn">Save</button>
    <button className="cancel-btn">Cancel</button>
  </div>
</div>

  );

  
  
  // Styles
  
  
  
  // Styles

  
};

export default AddTiffinCenter;
